const https = require('react-http-client')
const { ClientLayerFSM } = require("./StateMachine/ClientLayerFSM")
const Validator = require("./ValidatorLayer/Validator")
const NetworkServices = require("./NetworkLayer/RequestForwarder")
const constants = require('../ClientLayerLibrary/Constants').constants
//const fs = require('fs')
let fsm = null

function start(auth_params, data_callback, logger){
    fsm = new ClientLayerFSM({auth_params : auth_params,
                              authentication_method : (auth_params)=>{ 
                                                                        let currServerIndex = 0
                                                                        const func = ()=>{
                                                                        const authServers = auth_params.auth_server
                                                                        const numAuthServers = authServers.length
                                                                        const url = authServers[currServerIndex] + "/auth/" + JSON.stringify(auth_params.credentials)
                                                                        https.get(url)
                                                                        .then(data => {
                                                                          logger.debug(`Response from auth_server: ${JSON.stringify(data)}`)
                                                                          //data = JSON.parse(res)
                                                                          //logger.debug(data)
                                                                          try{
                                                                            if(data.success){
                                                                              fsm.handleEvent("auth_response", {success: true, conn_params : "http://" + data.feed_server})
                                                                            } else if (data.code === constants.error_codes.no_feed_server) {
                                                                              const retryInterval = 5000
                                                                              logger.warn(`No feed server provided from authenticator, retrying in ${retryInterval} ms`);
                                                                              setTimeout(()=>func(), retryInterval)
                                                                            }
                                                                            else {
                                                                              fsm.handleEvent("auth_response", data)
                                                                            }
                                                                          }catch(err){
                                                                            logger.warn(`Exceptions while handling auth_response, details: ${err.message}`)
                                                                          }
                                                                        })
                                                                        .catch(error=>{
                                                                            currServerIndex = (currServerIndex + 1) % numAuthServers
                                                                            if (error.response) {
                                                                            // The request was made and the server responded with a status code
                                                                            logger.warn('Error status:', error.response.status);
                                                                            logger.warn('Error data:', error.response.data);
                                                                          } else if (error.request) {
                                                                            // The request was made but no response was received
                                                                            logger.warn('No response received');
                                                                          } else if (error.code === 'ECONNREFUSED') {
                                                                            const retryInterval = 5000
                                                                            logger.warn(`No response from auth_server, retrying in ${retryInterval} ms`);
                                                                            setTimeout(()=>func(), retryInterval)
                                                                          } 
                                                                          else {
                                                                            // Something happened in setting up the request that triggered an error
                                                                            const retryInterval = 5000
                                                                            logger.warn(`No response from auth_server, retrying in ${retryInterval} ms`);
                                                                            setTimeout(()=>func(), retryInterval)
                                                                          }
                                                                        })
                                                                        //.err(err =>{ 
                                                                        //  logger.warn(`Error while authenticating details: ${err.message}, retrying in ${retryInterval} seconds`)
                                                                        //})
                                                                      }
                                                                      
                                                                      func()
                                                                    },
                              feed_server_conn_method : NetworkServices.connect,
                              connection_layer_termination_method : NetworkServices.disconnect,
                              intent_handler : (intent)=>{
                                Validator.validateRequest(intent)
                                NetworkServices.forward(intent)
                              },
                              subscription_dictionary : new Set(),
                              data_callback: data_callback,
                              logger : logger})
    NetworkServices.setDisconnectionHandler(reason=>{
      fsm.handleEvent("disconnect", reason)
    })
    fsm.start()
}


function executeIntent(intent){
    fsm.handleEvent("client_intent", intent)
}

